  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0117493 includes Surface
  underway, chemical, meteorological and physical data collected from USS BOLD in
  the Gulf of Mexico from 2006-06-06 to 2006-09-11. These data include BAROMETRIC
  PRESSURE, Partial pressure (or fugacity) of carbon dioxide - water, SALINITY and
  SEA SURFACE TEMPERATURE. The instruments used to collect these data include Carbon
  dioxide (CO2) gas analyzer and Shower head chamber equilibrator for autonomous carbon
  dioxide (CO2) measurement.nnThese data were collected by Wei-Jun Cai, Wei-Jen Huang
  and Yongchen Wang of University of Georgia; School of Marine Programs as part of
  the Coastal_UG_Gulf_of_Mexico_2006 data set. CDIAC assigned the following cruise
  ID(s) to this data set: 31B520060606 (GM0606) and 31B520060906 (GM0609).nnThe Global
  Coastal Carbon Data Project data includes the bottle (discrete) and surface (underway)
  carbon-related measurements from coastal research cruises, the data from time series
  cruises and coastal moorings. The coastal regions data are very important for the
  understanding of carbon cycle on the continental margins.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
